import React from "react";
import SocialItem from "./SocialItem";

function Social() {
  return (
    <ul className="list-group">
      <SocialItem
        p={{
          media: "Facebook",
          id: "facebook",
          img: "./images/haitam.jpg",
        }}
      />
      <SocialItem
        p={{
          media: "Youtube",
          id: "youtube",
          img: "https://picsum.photos/id/238/60",
        }}
      />
      <SocialItem
        p={{
          media: "Instagram",
          id: "instagram",
          img: "https://picsum.photos/id/239/60",
        }}
      />
    </ul>
  );
}

export default Social;
